import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import IconButton from '@mui/material/IconButton';
import MailIcon from '@mui/icons-material/Mail';
import Badge from '@mui/material/Badge';
import NotificationsIcon from '@mui/icons-material/Notifications';
import AccountCircle from '@mui/icons-material/AccountCircle';
import Typography from '@mui/material/Typography';
import ButtonBase from '@mui/material/ButtonBase';
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';


const MobileMenu = props => {
    const isMobileMenuOpen = Boolean(props.mobileMoreAnchorEl)
    return (
        <Menu
            // sx={{width:230, height:300, padding:0, justifyContent:'center'}}
            anchorEl={props.mobileMoreAnchorEl}
            anchorOrigin={{ vertical: "bottom", horizontal: "right", }}
            id={props.mobileMenuId}
            keepMounted
            transformOrigin={{ vertical: "top", horizontal: "right" }}
            open={isMobileMenuOpen}
            onClose={props.onClose}
            position="sticky">

            <MenuItem
                sx={{height:20}}>
                <Button focusRipple textalign='center'>
                    <Typography
                        component="span"
                        variant="button"
                        onClick={props.aboutHandler}
                        color="inherit">
                        About Us
                    </Typography>
                </Button>
            </MenuItem><MenuItem>
                <Button focusRipple textalign='center'>
                    <Typography
                        component="span"
                        variant="button"
                        onClick={props.loginHandler}
                        color="inherit">
                        Login
                    </Typography>
                </Button>
            </MenuItem>
            <MenuItem>
                <IconButton size="large" aria-label='show 4 new mails' color="inherit">
                    <Badge badgeContent={4} color="error"><MailIcon /></Badge>
                    <p>Messages</p>
                </IconButton>
            </MenuItem>
            <MenuItem>
                <IconButton size="large" aria-label='show 17 new notifications' color="inherit">
                    <Badge badgeContent={17} color="error"><NotificationsIcon /></Badge>
                    <p>Notifications</p>
                </IconButton>
            </MenuItem>
            <MenuItem>
                <IconButton
                    size="large"
                    aria-label='account of currunt user'
                    aria-haspopup="true"
                    aria-controls={props.mobileMenuId}
                    // onClick={props.onOpen} 
                    color="inherit">
                    <AccountCircle />
                    <p>Profile</p>
                </IconButton>
            </MenuItem>
            <MenuItem>
                <IconButton
                    size="large"
                    aria-label='account of currunt user'
                    aria-haspopup="true"
                    aria-controls={props.mobileMenuId}
                    // onClick={props.onOpen}
                    color="inherit">
                    <AccountCircle />
                    <p>Account</p>
                </IconButton>
            </MenuItem>

        </Menu>
    );
};
export default MobileMenu;
